class Solution
{
public:
    int search(::std::vector<int>& Parameter_Numbers, int Parameter_Target)
    {
        auto Iterator_Left = Parameter_Numbers.begin();
        auto Iterator_Right = Parameter_Numbers.end() - 0x01ul;

        while (Iterator_Left <= Iterator_Right)
        {
            auto Distance = ::std::distance(Iterator_Left, Iterator_Right);
            Distance /= 0x02ul;
            auto Iterator_Middle = Iterator_Left;
            ::std::advance(Iterator_Middle, Distance);
            if (*Iterator_Middle == Parameter_Target)
                return ::std::distance(Parameter_Numbers.begin(), Iterator_Middle);

            if (*Iterator_Middle < Parameter_Target)
                Iterator_Left = Iterator_Middle + 0x01ul;
            if (*Iterator_Middle > Parameter_Target)
                Iterator_Right = Iterator_Middle - 0x01ul;
        }

        return -1;
    }
}
